// Coloque aqui suas actions
export const SAVE_LOGIN = 'SAVE_LOGIN';
export const SAVE_WALLET = 'SAVE_WALLET';

export const saveLogin = ({ email }) => ({
  type: SAVE_LOGIN,
  email,
});

export const saveWallet = () => ({
  type: SAVE_WALLET,
});
